tables.table_schema:
CREATE TABLE DietPlan (
  DietPlanID INT PRIMARY KEY,
  DietName VARCHAR,
  DailyCalories INT
);

CREATE TABLE FitnessPlan (
  FitnessPlanID INT PRIMARY KEY,
  PlanName VARCHAR,
  ExerciseRoutine VARCHAR,
  DurationInDays INT
);

CREATE TABLE Member (
  MemberID INT PRIMARY KEY,
  Name VARCHAR,
  Age INT,
  Gender VARCHAR
);

CREATE TABLE VisualizationData (
  DataID INT PRIMARY KEY,
  DataType VARCHAR,
  ChartType VARCHAR,
  DataValues VARCHAR
);
